느낌상 죽이려는 사람보단, 죽으려고 하는 사람이 나쁜 사람이고.
죽이려는 사람은 착한 사람인데, 죽이면 인생 망가지고 뭐 그런식이다 보니깐...
죽이지 못하게 막고 죽이려는 착한사람을 구해주는 그런 내용 아닐까요? 아니면 말구요 ㅎㅎ;;

