이제 베도이야긴 나올수가 없다. 왜냐면 ㅋㅋㅋ 내용은 같아도 작가님이 구성 싹~~다 바꾸시고
다다다다 새로 그리신거다;;;;;;;;;;;;; 이건 새 작품이다 새작품;;;
무서운건 이게 다 창작 !! 꺄약!!!!!!!!!!!! 작가님 -_-b 너무 완벽하게 멋져

오 정말 재미있습니다. 하지만 아직 베도에서 본 부분이군요.

오늘의 명대사: &quot;팔자라고 생각하며 한숨만 쉬다 죽는 병신같은 짓은 하지 않을꺼야.&quot;
그렇다면 답은 혁명임! 무기를 들어라!

